import { double, full, king, queen } from "../../assets";

export const KING = {
  title: "King One Bed",
  body: [
    "Comfortable King Size Bed",
    "Large Clean Spacious Room",
    "Beautiful View of Stripe Square",
    "Floor to Ceiling Windows",
    "5 Star Room Service Available",
  ],
  image: king,
};

export const QUEEN = {
  title: "Queen One Bed",
  body: [
    "Cozy Queen Size Bed",
    "Large Clean Spacious Room",
    "Beautiful View of the Iconic Stripe Bridge",
    "Floor to Ceiling Windows",

    "5 Star Room Service Available",
  ],
  image: queen,
};

export const FULL = {
  title: "Full One Bed",
  body: [
    "Plush Full Size Bed",
    "Large Clean Comfortable Room",
    "Stirring Views of Stripe Square",
    "Floor to Ceiling Windows",

    "5 Star Room Service Available",
  ],
  image: full,
};

export const DOUBLE = {
  title: "Double Two Bed",
  body: [
    "Two Cozy Double Beds",
    "Cozy Clean Room",
    "Overlooking the iconic Chateau Stripe Restaurant",
    "Floor to Ceiling Windows",

    "5 Star Room Service Available",
  ],
  image: double,
};
